import axios from "axios";
// Export an object containing methods we'll use for accessing the Dog.Ceo API
export default {
  getEvent: function () {
    return axios.get(
      "https://rest.bandsintown.com/v4/artists/Primus/events/?app_id=451f31b2808001d069daed45c32a9dac"
    );
  },
};
